import types from 'prop-types';
import React from 'react';
import classNames from 'classnames'

// Styles

import './styles.scss';

// ----------------

export const Navbar = ({isActive, links }) => {




  const modify = classNames({
    'navbar__indicator--active': isActive,
  });

  return (
    <div className="navbar">
      {links.map(({ label }, index) => {
        isActive = (label === "Projects")
        return (
          <div className = "navbar__item" key={index}>
            <div className={`navbar__indicator ${modify}`}></div>
            <a className="navbar__label" href="\#">{label}</a>
          </div>
        );
      })}
    </div>
  );
};


// ----------------

// Type of props

Navbar.propTypes = {
  prop: types.string,
};

// Default value for props

Navbar.defaultProps = {};
